function isAndroid() {
	var ua = navigator.userAgent.toLowerCase();
	return ua.indexOf("android") > -1
}

function isBlackberry() {
	var ua = navigator.userAgent.toLowerCase();
	return ua.indexOf("blackberry") > -1
}

function isIos() {
	var ua = navigator.userAgent.toLowerCase();
	return ua.match(/(ipad|iphone|ipod)/g)
}

function scrollToDiv(el) {
	$("html,body").animate({
		scrollTop: $(el).offset().top
	})
}

